        public string Get_XAC_Import(string Export)
        {
            int index = this.AFO_TAGGED_VALUES_EXPORT_XAC.FindIndex( x => x == Export);

            if(index >= 0)
            {
                return (this.AFO_TAGGED_VALUES_IMPORT_XAC[index]);
            }
            else
            {
                return (Export);
            }

        }

		public void Choose_Metamodel(){

            Forms.Choose_Metamodel_Form choose = new Forms.Choose_Metamodel_Form(this);
            var res =  choose.ShowDialog();

           //MessageBox.Show(res.ToString());

            if(res.ToString() != "Abort" && res.ToString() != "Cancel")
            {

                switch (this.Metamodel_name)
                {
                    case "NAFv3.1":
                        this.Create_NAFv31();
                        break;
                    case "NAFv4 - OpArch":
                        this.Create_NAFv4_OpArch();
                        break;
                    case "NAFv4 - Logical":
                        this.Create_NAFv4_Logical();
                        break;
                    case "NAFv4 - Physical Resource":
                        this.Create_NAFv4_Physical();
                        break;
                    case "NAFv4 - Funktionsketten":
