        public List<Element_Metamodel> Find_StereoType_Sys_Komponententyp(Database Data, string Sys_KomponentenTyp)
        {
            List<string> m_StereoType = new List<string>();
            List<string> m_XAC_Attribut = Data.metamodel.m_Elements_Definition.Select(x => x.XAC_Attribut).ToList();

            List<Element_Metamodel> ret = new List<Element_Metamodel>();

            int index = Data.metamodel.m_Elements_Definition.FindIndex(x => x.XAC_Attribut == Sys_KomponentenTyp);

            if(index >= 0)
            {
                /*   m_StereoType.Add(Data.metamodel.m_Elements_Definition.Select(x => x.Stereotype).ToList()[index]);
                   m_StereoType.Add(Data.metamodel.m_Elements_Usage.Select(x => x.Stereotype).ToList()[index]);
                   m_StereoType.Add(Data.metamodel.m_Elements_Usage.Select(x => x.Stereotype).ToList()[index]);
                   m_StereoType.Add(Data.metamodel.m_Elements_Usage.Select(x => x.Type).ToList()[index]);
                   */
                ret.Add(Data.metamodel.m_Elements_Definition[index]);
                ret.Add(Data.metamodel.m_Elements_Usage[index]);
            }
            else
            {
                int index_sys = Data.metamodel.m_Elements_SysArch_Definition.FindIndex(x => x.XAC_Attribut == Sys_KomponentenTyp);

                if (index_sys == -1)
                {

                    ret.Add(Data.metamodel.m_Elements_Definition[0]);
                    ret.Add(Data.metamodel.m_Elements_Usage[0]);

                }
                else
                {
                    ret.Add(Data.metamodel.m_Elements_SysArch_Definition[index_sys]);
                    ret.Add(Data.metamodel.m_Elements_SysArch_Definition[index_sys]);
                }
                   

                
                
            }
          

            return (ret);
        }


      
        public string Find_Sys_KomponentenTyp(Database Data, Repsoitory_Elements.NodeType recent, EA.Repository repository)
        {

            string Sys_KomponentenTyp = "kein";
            

            if(repository.GetElementByGuid(recent.Classifier_ID).Stereotype != null)
            {
                int i1 = 0;
                do
                {
                    //if (recent.Type == Data.metamodel.Elements_Part_Type[i1] || recent.Type == "Class")
                    //{
                        if (repository.GetElementByGuid(recent.Classifier_ID).Stereotype == Data.metamodel.m_Elements_Definition[i1].Stereotype)
                        {
                            Sys_KomponentenTyp = Data.metamodel.m_Elements_Definition[i1].XAC_Attribut;
                            i1 = Data.metamodel.m_Elements_Definition.Count;
                        }
                    //}
                    i1++;
                } while (i1 < Data.metamodel.m_Elements_Definition.Count);
            }

            //Überprüfen ob aktuelle Klasse eine Schnittstelle (Port darstellt)
            //   XML help = new XML();
            //   string SQL = "SELECT Object_Type FROM t_object WHERE PDATA1 = '" + recent.Classifier_ID + "'";
            //   string xml_String = repository.SQLQuery(SQL);
           // List<string> help_Class = help.Xml_Read_Attribut("Object_Type", xml_String);
          //  Repository_Elements repository_Elements = new Repository_Elements();
            string help_Class = recent.Get_Type_By_Classifier(Data, recent.Classifier_ID);

            if (help_Class != null)
            {
                if(help_Class == "Port")
                {
                    Sys_KomponentenTyp = Data.SYS_ENUM.SYS_KOMPONENTENTYP[(int)SYS_KOMPONENTENTYP.Schnittstelle];
                }
            }

            return (Sys_KomponentenTyp);
        }

